% 构造LMI不等式
lmiterm([1 1 1 Y], A, 1, 's');        
lmiterm([1 1 1 0], B1 * B1');     
lmiterm([1 1 1 0], Q);         

% 第一行第二列块：
lmiterm([1 2 1 Y], C_2, -1);                    

% 第二行第二列块：
lmiterm([1 2 2 0], -1);

lmiterm([2 1 1 Y], A, 1, 's');        
lmiterm([2 1 1 0], B1 * B1');        
lmiterm([2 1 1 0], Q);         

% 第一行第二列块：
lmiterm([2 1 2 X], 1/(gamma*gamma), C_1');                        

% 第二行第二列块：
lmiterm([2 2 2 0], -1);


lmiterm([-3,1,1,Y],1,1); 

% 创建LMI系统
lmisys = getlmis;

% 求解LMI
[tmin, xfeas] = feasp(lmisys);

% 提取解
Y_inf = dec2mat(lmisys, xfeas, Y);

% 显示结果
disp('Y:');
disp(Y_inf);